import './App.css';
import { BrowserRouter as Router, Routes } from 'react-router-dom';
import Dashboard from './admin/Dashboard';
import Appointment from './components/Appointment';
import VisitorDashboard from './components/appointment/VisitorDashboard';
import Signup from './components/Signup';
import Home from './components/Home';
import Login from './components/Login';
import PrivateRoute from './PrivateRoute'; // Import PrivateRoute component

function App() {
  return (
    <div className="App">
      <Router>
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/login" element={<Login />} />
          <Route path="/registration" element={<Signup />} />

          {/* Use PrivateRoute for protected routes */}
          <PrivateRoute path="/appointment" element={<Appointment />} />
          <PrivateRoute path="/dashboard" element={<VisitorDashboard />} />
          <PrivateRoute path="/admin-dashboard" element={<Dashboard />} />
        </Routes>
      </Router>
    </div>
  );
}

export default App;
